import React from "react";
import { Link } from "react-router-dom";

import QueueIcon from '@material-ui/icons/Queue';

import "./Admin.scss";

import img1 from "./titlelog.png";

const Admin = () => {
  return (
    <>
      <div className="admin_container">
        <div className="left_sidebar">
          <div className="img">
            <img className="left_img" src={img1} alt="Error" />
          </div>

          <div className="links">
            <div className="link1">
                <div className="icon">
                    <QueueIcon/>
                </div>

              <Link className="link">Add Modle</Link>
            </div>
            <Link className="link">Add Category</Link>
            <Link className="link">Profile</Link>
            <Link className="link">Invitations</Link>
            <Link className="link">All Models</Link>
            <Link className="link">Emial Marketing</Link>
          </div>
        </div>
      </div>
    </>
  );
};

export default Admin;
